const Layout = ({ children }) => {
  const navBar = () => (
    <ul className="nav">
      <li className="nav-item">
        <a className="nav-link" href="/">
          Home
        </a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/login">
          Login
        </a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="/register">
          Register
        </a>
      </li>
    </ul>
  );
  return <>{navBar()}</>;
};

export default Layout;
